import React, {Component} from 'react';
import {NavLink} from 'react-router-dom'
import 'tachyons';


class Nav extends Component {
    render(){
        return (
            <nav className="dt w-100 border-box pt0 pb0 o-70 pa3 ph5-ns bg-white">
                <a className="dtc v-mid mid-gray link dim w-25" href="#" title="Home">
                    <img src="https://upload.wikimedia.org/wikipedia/en/thumb/3/3c/University_College_of_Engineering%2C_Osmania_University_logo.png/220px-University_College_of_Engineering%2C_Osmania_University_logo.png" className="dib h4" alt="Site Name" />
                </a>
                <div className="dtc v-mid w-75 tr">
                    <NavLink exact to="/" className="dim dark-red f3 f2-ns dib mr3 mr4-ns" activeClassName="active">Home</NavLink>
                    <NavLink exact to="/events" className="dim dark-red f3 f2-ns dib mr3 mr4-ns" activeClassName="active" title="Events">Events</NavLink>
                    <NavLink exact to="/committee" className="dim dark-red f3 f2-ns dib mr3 mr4-ns" activeClassName="active" title="Organizing Committee">Organising Committee</NavLink>
                    <NavLink exact to="/sponsors" className="dim dark-red f3 f2-ns dib mr3 mr4-ns" activeClassName="active" title="Previous Sponsors">Previous Sponsors</NavLink>
                    <NavLink exact to="/contact" className="dim dark-red f3 f2-ns dib mr3 mr4-ns" activeClassName="active" title="Contact">Contact Us</NavLink>
                </div>
            </nav>

        );
    }
}
export default Nav;
